const Navbar = (props, {bg}) => {

    const styles = {
        nav: {
            backgroundColor: bg
        }
    }

    return (
        <nav style={styles.nav} className={"container test"}>
            <p>test</p>
            props.children;
        </nav>
    )
}

export default Navbar;
